import React from "react";
import "./navbar.scss";

import logo from "/Users/user/Desktop/REACT/pamoka/src/img/logotipas.jpg";

class Navbar extends React.Component {
  constructor() {
    super();

    this.state = {
      showMenu: false,
    };
  }
  render() {
    return (
      <nav className="grid__navbar">
        <div className="container">
          <div className="nav-container">
            <div className="logo">
              <img src={logo} alt="" />
            </div>
            <div className="menu-expand">
              <span className="expand-line"></span>
              <span className="expand-line"></span>
              <span className="expand-line"></span>
            </div>
          </div>
        </div>
      </nav>
    );
  }
}
export default Navbar;
